import React from 'react';
import styled from 'styled-components';

const Input = styled.input`
display:block;
border-radius:3px
`


class Loginpage extends React.Component{
    render(){
        return(
            <div className="hew">
                <Input type='text'/>
            </div>
        );
    }
}

export default Loginpage;
